import React from 'react';
import  ReactDOM  from 'react-dom/client';

import SearchPanel from './components/search-panel';
import AppHeader from './components/app-header';
import DataFromServer from './components/data-from-server';
import HeadData from './components/head-data-from-server';
import AddData from './components/add-data/add-data';


const customData = {
    num: 11,
    name: "NNNNN FFFFFFFF",
    birthday: "12.11.1995",
    points: 300
}

const App = ()=>{
    return (
    <div className="rowcol-lg-4 col-md-6 mx-auto">
    <AppHeader/>
    <SearchPanel/>
    <HeadData/>
    <DataFromServer/>
    <AddData
        num={customData.num} 
        name={customData.name} 
        birthday={customData.birthday} 
        points={customData.points}/>
    </div>);
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <App />
);
